import React, { Component } from "react";
import Layout from "../components/Layout";
import Skill from "../content/Skill";
import ProjectsPage from "../content/Projects";



class Index extends Component {

    
    
        render() {
            return (
                <div>
                     <Layout>
                     <Skill />
                <ProjectsPage />
                    </Layout> 
                </div>
            )
        }
    }


export default Index;
